import React from 'react';
import { Form, Input, InputNumber, Select, Button, Upload, message } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import axios from 'axios';

const { Option } = Select;

const Formulario = () => {
  const onFinish = async (values) => {
    const formData = new FormData();

    for (const key in values) {
      if (key === 'Foto_Perfil' && values[key]) {
        formData.append(key, values[key][0].originFileObj);
      } else {
        formData.append(key, values[key]);
      }
    }

    try {
      const response = await axios.post('http://localhost:8000/Ajustadores/RegistrarAjustadores', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      if (response.status === 200) {
        message.success('Formulario enviado exitosamente');
      } else {
        message.error('Error al enviar el formulario');
      }
    } catch (error) {
      console.error(error);
      if (error.response && error.response.data && error.response.data.errors) {
        const errors = error.response.data.errors;
        for (const key in errors) {
          errors[key].forEach((message) => message.error(`${key}: ${message}`));
        }
      } else {
        message.error('Error al enviar el formulario: ' + error.message);
      }
    }
  };

  return (
    <Form
      name="formulario"
      layout="vertical"
      onFinish={onFinish}
    >
      {/* Campos del formulario */}
      <Form.Item
        label="Nombres"
        name="Nombres"
        rules={[{ required: true, message: 'Por favor ingrese sus nombres' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Apellidos"
        name="Apellidos"
        rules={[{ required: true, message: 'Por favor ingrese sus apellidos' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Edad"
        name="Edad"
        rules={[{ required: true, message: 'Por favor ingrese su edad' }]}
      >
        <InputNumber min={0} />
      </Form.Item>

      <Form.Item
        label="Sexo"
        name="Sexo"
        rules={[{ required: true, message: 'Por favor seleccione su sexo' }]}
      >
        <Select placeholder="Seleccione">
          <Option value="masculino">Masculino</Option>
          <Option value="femenino">Femenino</Option>
          <Option value="otro">Otro</Option>
        </Select>
      </Form.Item>

      <Form.Item
        label="Teléfono"
        name="Telefono"
        rules={[{ required: true, message: 'Por favor ingrese su teléfono' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Correo Electrónico"
        name="Correo_Electronico"
        rules={[
          { required: true, message: 'Por favor ingrese su correo electrónico' },
          { type: 'email', message: 'Ingrese un correo electrónico válido' },
        ]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Kilometraje Inicial"
        name="Kilometraje_Inicial"
        rules={[{ required: true, message: 'Por favor ingrese el kilometraje inicial' }]}
      >
        <InputNumber min={0} />
      </Form.Item>

      <Form.Item
        label="Número de Llave"
        name="Numero_De_Llave"
        rules={[{ required: true, message: 'Por favor ingrese el número de llave' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Modelo del Vehículo"
        name="Modelo_Vehiculo"
        rules={[{ required: true, message: 'Por favor ingrese el modelo del vehículo' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Placa del Vehículo"
        name="Placa_Vehiculo"
        rules={[{ required: true, message: 'Por favor ingrese la placa del vehículo' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Modelo del Celular"
        name="Modelo_Celular"
        rules={[{ required: true, message: 'Por favor ingrese el modelo del celular' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="IMEI"
        name="IMEI"
        rules={[{ required: true, message: 'Por favor ingrese el IMEI' }]}
      >
        <Input />
      </Form.Item>

      <Form.Item
        label="Foto de Perfil"
        name="Foto_Perfil"
        valuePropName="fileList"
        getValueFromEvent={normFile}
        rules={[{ required: true, message: 'Por favor suba la foto de perfil' }]}
        extra="Suba su foto de perfil"
      >
        <Upload name="Foto_Perfil" listType="picture" beforeUpload={() => false}>
          <Button icon={<UploadOutlined />}>Subir Foto</Button>
        </Upload>
      </Form.Item>

      <Form.Item
        label="Tarjeta de Gasolina"
        name="Tarjeta_Gasolina"
        rules={[{ required: false }]}
      >
        <Input />
      </Form.Item>

      <Form.Item>
        <Button type="primary" htmlType="submit">
          Enviar
        </Button>
      </Form.Item>
    </Form>
  );
};

// Función para normar los archivos subidos
const normFile = (e) => {
  if (Array.isArray(e)) {
    return e;
  }
  return e && e.fileList;
};

export default Formulario;
